import axios from "axios";
import { useEffect, useState } from "react";

const Home = () => {
  const [todos, setTodos] = useState([]);
  useEffect(() => {
    const fetchTodos = async () => {
      await axios
        .get("http://localhost:4000/api/todos")
        .then((res) => setTodos(res.data));
    };
    fetchTodos();
  }, []);
  return (
    <div className="home">
      <h2>Home</h2>
    </div>
  );
};

export default Home;
